# Function to extract articles read from behavior_df
def extract_articles_read(df, model_dict):
    articles_read = {}

    for index, row in df.iterrows():
        user_id = row['User ID']
        timestamp = row['Timestamp']
        key = [str(user_id), str(timestamp)]

        key_str = '["' + '", "'.join(key) + '"]'

        if key_str in model_dict:
            impressions = str(row['Impressions']).split()
            articles_read[key_str] = impressions

    return articles_read

# Function to create dictionary needed from model_dfs
def create_dictionary_from_dataframe(df, key_column, value_column):
    dictionary = {}

    for index, row in df.iterrows():
        key = row[key_column]
        value = row[value_column]

        if key not in dictionary:
            dictionary[key] = value
        else:
            dictionary[key].extend(value)

    return dictionary

